import React, { useState } from "react";
import { Route, Switch, Redirect } from "react-router-dom";

const App = () => {
  return (
    <>
      <h1>Hello world!</h1>
      <Route path="/register">
        <h2>Solo aparezco en register</h2>
      </Route>
    </>
  );
};

export default App;
